import React, { useState } from 'react'
import axios from 'axios'
import { useNavigate } from 'react-router-dom';

export default function Logout({setLogedIn}) {
    const[user,setuser]=useState([]);

    const redirect=useNavigate()

    function Logconf()
    {
        axios.get('http://127.0.0.1:8000/v3/logout/')
        redirect('/login')
    }
  return (
    <>
    <div>
        <center><h4>ARE YOU WNAT LOGOUT</h4>
        <button className='btn btn-outline-success' onClick={()=>Logconf()}>YES</button>
        <button className='btn btn-outline-warning'>NO</button></center>
    </div>

    </>
  )
}
